import Post from '../components/Post';
import '../style/Home.css'

function Home() {

  const test = { name:"prvi", date:"1.1.2022", content:"post", image:"https://images.dog.ceo/breeds/leonberg/n02111129_454.jpg" }

  return (
    <div>
      <Post post={test} />

    </div>
  );
}

export default Home;
